import React from 'react';
import headerLogo from '../images/logo.svg';
import { Link } from 'react-router-dom';

function Header({loggedIn, email}) {
  return (
    <header className="header">
        <a href="#">
          <img src={headerLogo} alt="Логотип" className="header__logo" />
        </a>



          {loggedIn? <Link to="/login" className="header__navBar">Выйти</Link> : <Link to="/register" className="header__navBar">Регистрация</Link>}

        <ul className="header__nav">
          <li>{email}</li>
          <li><button>{loggedIn? <Link to="/login" className="header__navBar">Выйти</Link> : <Link to="/register" className="header__navBar">Регистрация</Link>}</button></li>
        </ul>

    </header>
  );
}

export default Header;


